import React from "react";
import Nav from "../Nav/Nav"
import { HomeWrapper} from "../Nav/NavStyles";
import {pinkhairs} from "../images/pinkhairs"

const Home = () => {
  return (
    <HomeWrapper>
         <Nav />
      <body>
        <p>Home</p>
        <img src={pinkhairs}/>
      </body>
      </HomeWrapper>
  );
}

export default Home;
